import React from 'react';
import { Form, Button } from 'react-bootstrap';

export default function LoginAuth() {
    return (
        <div className="login_auth">
            <div className="login_auth_flex">
                <div className="la_body">
                    <h2>Login</h2>
                    <Form>
                        <Form.Group id="email">

                        </Form.Group>
                    </Form>
                </div>
            </div>
        </div>
    )
}
